(10, 'terms_condition', 'terms_condition', '<p>&nbsp;</p>\r\n<p># TERMS AND CONDITIONS<br># الشروط والأحكام</p>\r\n<p>---</p>\r\n<p>## 1. GENERAL PROVISIONS<br>## 1. أحكام عامة</p>\r\n<p>1.1. Using any function or Services of the Portal and Mobile Apps, any individual (hereinafter referred to as the \"User\"), irrespective of their legal status and civil capacity, is subject to the rules and restrictions specified in this User Agreement (hereinafter referred to as the \"Agreement\").</p>\r\n<p>1.1. عند استخدام أي وظيفة أو خدمة من خدمات البوابة وتطبيقات الهاتف المحمول، فإن أي فرد (يشار إليه فيما يلي بـ \"المستخدم\")، بغض النظر عن وضعه القانوني وقدرته المدنية، يخضع للقواعد والقيود المحددة في اتفاقية المستخدم هذه (يشار إليها فيما يلي بـ \"الاتفاقية\").</p>\r\n<p>1.2. The User gives their consent to obey all provisions of this Agreement during registration in the Portal or Mobile Apps. In case of disagreement with any provision of this Agreement, the User is not allowed to use the Service of the Administrator.</p>\r\n<p>1.2. يوافق المستخدم على الالتزام بجميع أحكام هذه الاتفاقية أثناء التسجيل في البوابة أو تطبيقات الهاتف المحمول. في حال عدم موافقته على أيٍّ من أحكام هذه الاتفاقية، لا يُسمح له باستخدام خدمات المسؤول.</p>\r\n<p>1.3. The Administrator may amend, supplement or in any other way modify the Agreement without prior notification of a User.</p>\r\n<p>1.3. يجوز للمسؤول تعديل الاتفاقية أو استكمالها أو تغييرها بأي طريقة أخرى دون إشعار مسبق للمستخدم.</p>\r\n<p>1.4. The Agreement with all amendments and supplements is posted on the Portal and Mobile Apps. Hereby the User consents to amendments and alterations of the Agreement without receiving of any special confirmation from User.</p>\r\n<p>1.4. تم نشر الاتفاقية مع جميع التعديلات والإضافات على البوابة الإلكترونية وتطبيقات الجوال. بموجب هذا، يوافق المستخدم على تعديلات الاتفاقية وتعديلاتها دون تلقي أي تأكيد خاص من المستخدم.</p>\r\n<p>1.5. Following terms in the present Agreement shall have the following meaning unless the context requires otherwise:</p>\r\n<p>1.5. يكون للمصطلحات التالية في هذه الاتفاقية المعاني الموضحة أدناه، ما لم يقتض السياق خلاف ذلك:</p>\r\n<p>&bull; Administrator - \"RideGO\", a company established under the laws of Qatar.<br>&bull; المسؤول - \"RideGO\"، شركة تأسست بموجب قوانين قطر.</p>\r\n<p>&bull; Mobile App - an application for mobile devices \"RideGO\" for iOS, Android.<br>&bull; تطبيق الجوال - تطبيق للأجهزة المحمولة \"RideGO\" لأنظمة iOS و Android.</p>\r\n<p>&bull; User - any legally capable individual who is at least 18 (eighteen) years old at the moment of registration or a duly registered legal entity who accepted the provisions of this Agreement and uses Services of the Portal and Mobile Apps.<br>&bull; المستخدم - أي فرد ذو أهلية قانونية يبلغ من العمر 18 (ثمانية عشر) عامًا على الأقل وقت التسجيل، أو كيان قانوني مسجل حسب الأصول، والذي قبل أحكام هذه الاتفاقية ويستخدم خدمات البوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>&bull; Service - any operation, other than supply of goods, which is related to the provision of Service, used in the performance of a particular action or certain activities to meet individual needs of the User.<br>&bull; الخدمة - أي عملية، بخلاف توريد البضائع، تتعلق بتقديم الخدمة، وتستخدم في أداء إجراء معين أو أنشطة معينة لتلبية الاحتياجات الفردية للمستخدم.</p>\r\n<p>&bull; Personal data - information or set of data about an individual who is identified or can be specifically identified with their use.<br>&bull; البيانات الشخصية - معلومات أو مجموعة بيانات حول فرد تم تعريفه أو يمكن تعريفه على وجه التحديد باستخدامها.</p>\r\n<p>1.6. Additional terms of use of certain resources and Services can be specified on the Portal and Mobile Apps.</p>\r\n<p>1.6. يمكن تحديد شروط استخدام إضافية لموارد وخدمات معينة على البوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>---</p>\r\n<p>## 2. USER REGISTRATION<br>## 2. تسجيل المستخدم</p>\r\n<p>2.1. To use certain Services of the Portal and Mobile Apps, the User is obliged to perform registration, resulting in the creation of a unique account for the User to get access to the Services of the Portal and Mobile Apps.</p>\r\n<p>2.1. لاستخدام خدمات معينة من البوابة وتطبيقات الهاتف المحمول، يلتزم المستخدم بإجراء التسجيل، مما يؤدي إلى إنشاء حساب فريد للمستخدم للوصول إلى خدمات البوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>2.2. The User shall provide accurate information about themselves while filling in an application form during registration.</p>\r\n<p>2.2. يجب على المستخدم تقديم معلومات دقيقة عن نفسه عند ملء نموذج التسجيل.</p>\r\n<p>2.3. If the User provides false information during registration or later, within the use of Services of the Portal and Mobile Apps, the Administrator has a right to suspend or terminate the account (registration) of the User without notice or obtaining any consent.</p>\r\n<p>2.3. إذا قدم المستخدم معلومات خاطئة أثناء التسجيل أو لاحقًا، ضمن استخدام خدمات البوابة وتطبيقات الهاتف المحمول، يحق للمسؤول تعليق أو إنهاء حساب (تسجيل) المستخدم دون إشعار أو الحصول على أي موافقة.</p>\r\n<p>2.4. If the User\'s actions may lead to a breach of any rules and regulations of the applicable law, human rights and the possibility of claims towards the Administrator or ensuring responsibility of the Administrator for the actions of the User, the Administrator has a right to block User\'s actions immediately and suspend or delete the account of the User without notification or obtaining any consent from the User.</p>\r\n<p>2.4. إذا كانت إجراءات المستخدم قد تؤدي إلى خرق أي قواعد ولوائح القانون المعمول به، وحقوق الإنسان، وإمكانية تقديم مطالبات ضد المسؤول أو ضمان مسؤولية المسؤول عن تصرفات المستخدم، يحق للمسؤول حظر تصرفات المستخدم فورًا وتعليق أو حذف حساب المستخدم دون إخطار أو الحصول على أي موافقة من المستخدم.</p>\r\n<p>2.5. Except cases expressly provided in this Agreement, the Administrator undertakes to ensure all necessary measures stipulated by the applicable legislation of Qatar and the requirements of reasonableness and good faith in order to protect Personal Data transmitted to the Administrator during registration of the User on the Portal and Mobile Apps.</p>\r\n<p>2.5. باستثناء الحالات المنصوص عليها صراحة في هذه الاتفاقية، يتعهد المسؤول بضمان كافة التدابير اللازمة المنصوص عليها في التشريعات القطرية المعمول بها ومتطلبات المعقولية وحسن النية من أجل حماية البيانات الشخصية المرسلة إلى المسؤول أثناء تسجيل المستخدم في البوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>2.6. By undertaking to comply with the requirements of this Agreement, the User gives their full, unconditional and irrevocable consent for the use of Personal Data, provided at registration on the Portal and Mobile Apps, in order to include such Personal Data in the database of Portal and Mobile Apps Users.</p>\r\n<p>2.6. بالتعهد بالامتثال لمتطلبات هذه الاتفاقية، يمنح المستخدم موافقته الكاملة وغير المشروطة وغير القابلة للإلغاء على استخدام البيانات الشخصية، المقدمة عند التسجيل في البوابة وتطبيقات الهاتف المحمول، من أجل تضمين هذه البيانات الشخصية في قاعدة بيانات مستخدمي البوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>2.7. The Administrator has a right to delete the User\'s account if it is not used during 12 calendar months.</p>\r\n<p>2.7. يحق للمسؤول حذف حساب المستخدم إذا لم يتم استخدامه لمدة 12 شهرًا تقويميًا.</p>\r\n<p>2.8. At registration on the Portal and Mobile Apps, the User shall enter a unique password. The User is fully responsible for the reliability of the password and protection of their own account.</p>\r\n<p>2.8. عند التسجيل في البوابة وتطبيقات الهاتف المحمول، يجب على المستخدم إدخال كلمة مرور فريدة. يتحمل المستخدم المسؤولية الكاملة عن موثوقية كلمة المرور وحماية حسابه الخاص.</p>\r\n<p>2.9. If a third party obtains access to User\'s account, the User must immediately notify the Administrator in order to ensure the appropriate measures if the User is able to confirm the possession of such specific account.</p>\r\n<p>2.9. إذا حصل طرف ثالث على حق الوصول إلى حساب المستخدم، يجب على المستخدم إخطار المسؤول على الفور لضمان اتخاذ التدابير المناسبة إذا كان المستخدم قادرًا على تأكيد ملكية هذا الحساب المحدد.</p>\r\n<p>2.10. The User ensures safety of information about passwords and other confidential information by themselves. The Administrator is not responsible for the consequences of the disclosure of User\'s confidential information about Personal Data (Username and password). This provision regulates both the voluntary transfer of User\'s Personal Data to third parties and the loss of confidential information.</p>\r\n<p>2.10. يضمن المستخدم سلامة المعلومات حول كلمات المرور والمعلومات السرية الأخرى بنفسه. المسؤول ليس مسؤولاً عن عواقب الكشف عن معلومات المستخدم السرية المتعلقة بالبيانات الشخصية (اسم المستخدم وكلمة المرور). ينظم هذا الحكم كلاً من النقل الطوعي للبيانات الشخصية للمستخدم إلى أطراف ثالثة وفقدان المعلومات السرية.</p>\r\n<p>---</p>\r\n<p>## 3. FINANCIAL TERMS AND VOUCHER SYSTEM<br>## 3. الشروط المالية ونظام القسائم</p>\r\n<p>3.1. RideGO Share:<br>For every payment processed through the Portal and Mobile Apps, RideGO shall retain a ten percent (10%) share of the total payment amount. However, if the driver remains committed to staying online in the application, efficiently delivering passengers, executing trips promptly, and maintaining excellent ratings, the commission rate shall be reduced to seven percent (7%).</p>\r\n<p>3.1. حصة RideGO:<br>مقابل كل دفعة تتم معالجتها عبر البوابة وتطبيقات الهاتف المحمول، تحتفظ RideGO بحصة قدرها عشرة بالمائة (10%) من إجمالي مبلغ الدفع. ومع ذلك، إذا كان السائق ملتزماً بالبقاء متصلاً في التطبيق وتوصيل الركاب بكفاءة وتنفيذ الرحلات بشكل سريع والحفاظ على تقييمات ممتازة، فإن معدل العمولة ينخفض إلى سبعة بالمائة (7%).</p>\r\n<p>3.2. Voucher Eligibility:<br>For every booking payment made by a User that equals or exceeds 30 Qatari Riyals (QR) or any multiplication thereof (e.g., 30 QR, 60 QR, 90 QR, etc.), the User will receive a voucher with a value of 1 Qatari Riyal (QR). This voucher will be applicable to future bookings or services as determined by the Administrator.</p>\r\n<p>3.2. أهلية القسيمة:<br>مقابل كل دفعة لخدمة حجز يقوم بها المستخدم تساوي أو تزيد عن 30 ريالاً قطريًا (QR) أو أي مضاعف لذلك (مثل 30 ريالاً قطريًا، 60 ريالاً قطريًا، 90 ريالاً قطريًا، إلخ)، سيحصل المستخدم على قسيمة بقيمة 1 ريال قطري (QR). ستكون هذه القسيمة قابلة للتطبيق على الحجوزات أو الخدمات المستقبلية وفقًا لما يحدده المسؤول.</p>\r\n<p>---</p>\r\n<p>## 4. PERSONAL DATA<br>## 4. البيانات الشخصية</p>\r\n<p>4.1. All issues regarding collecting, using, processing and protection of Users\' Personal data are regulated by a separate Privacy Statement placed on the Portal and Mobile App.</p>\r\n<p>4.1. تخضع جميع المسائل المتعلقة بجمع واستخدام ومعالجة وحماية البيانات الشخصية للمستخدمين لسياسة خصوصية منفصلة منشورة على البوابة وتطبيق الجوال.</p>\r\n<p>---</p>\r\n<p>## 5. PORTAL AND MOBILE APPS SERVICES<br>## 5. خدمات البوابة وتطبيقات الجوال</p>\r\n<p>5.1. The Portal and Mobile Apps are intended solely to provide information Services to the Users, including access to public domain information, information that is lawfully provided by third parties, intellectual property items, which are legally used by placing on the Portal and Mobile Apps.</p>\r\n<p>5.1. تهدف البوابة وتطبيقات الهاتف المحمول حصريًا إلى توفير خدمات معلومات للمستخدمين، بما في ذلك الوصول إلى معلومات المجال العام، والمعلومات التي يتم تقديمها بشكل قانوني من قبل أطراف ثالثة، وعناصر الملكية الفكرية، والتي يتم استخدامها بشكل قانوني من خلال وضعها على البوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>5.2. The Portal and Mobile Apps do not contain and are not purposed for posting of confidential information, restricted information, information of third parties, for posting of which the Portal and Mobile Apps have not obtained due permits and authorities.</p>\r\n<p>5.2. لا تحتوي البوابة وتطبيقات الهاتف المحمول ولا تهدف إلى نشر معلومات سرية، أو معلومات مقيدة، أو معلومات تابعة لأطراف ثالثة، والتي لم تحصل البوابة وتطبيقات الهاتف المحمول على التصاريح والسلطات اللازمة لنشرها.</p>\r\n<p>5.3. In case the Users detect information and/or intellectual property items with restricted use or with rights which belong to third parties, the User must contact the Administrator and report on such violation, indicating the internet address of information and/or intellectual property items, which allegedly violate the rights of third parties according to the User, and to report about the nature of such violation.</p>\r\n<p>5.3. في حال اكتشف المستخدمون معلومات و/أو عناصر ملكية فكرية مقيدة الاستخدام أو ذات حقوق تخص أطرافًا ثالثة، يجب على المستخدم الاتصال بالمسؤول والإبلاغ عن هذا الانتهاك، مع ذكر عنوان الإنترنت للمعلومات و/أو عناصر الملكية الفكرية، التي يُزعم أنها تنتهك حقوق أطراف ثالثة وفقًا للمستخدم، والإبلاغ عن طبيعة هذا الانتهاك.</p>\r\n<p>5.4. The Administrator, or other representative, authorized by the Administrator on a contractual basis, may involve third parties providing and/or offering Services to the Users through the Portal and Mobile Apps. The Administrator and the authorized representative provide such third parties informational, promotional and/or other Services exclusively related to the posting of information about such third parties, without giving any guarantees to the Users as for the quality of Services provided to the Users by third parties.</p>\r\n<p>5.4. يجوز للمسؤول، أو أي ممثل آخر مخول من قبل المسؤول على أساس تعاقدي، إشراك أطراف ثالثة تقدم و/أو تعرض خدمات للمستخدمين من خلال البوابة وتطبيقات الهاتف المحمول. يوفر المسؤول والممثل المخول لهذه الأطراف الثالثة خدمات معلوماتية وترويجية و/أو غيرها حصريًا، تتعلق بنشر معلومات حول هذه الأطراف الثالثة، دون تقديم أي ضمانات للمستخدمين بشأن جودة الخدمات المقدمة للمستخدمين من قبل أطراف ثالثة.</p>\r\n<p>5.5. The Administrator and any other authorized representative are not responsible and undertake no obligation concerning Services provided to the Users on the Portal and Mobile Apps by third parties.</p>\r\n<p>5.5. المسؤول وأي ممثل آخر مخول لا يتحملان المسؤولية ولا يتعهدان بأي التزام فيما يتعلق بالخدمات المقدمة للمستخدمين على البوابة وتطبيقات الهاتف المحمول من قبل أطراف ثالثة.</p>\r\n<p>5.6. Provision of Services to the Users by third parties is carried out on the basis of certain agreements between specific Users and third parties, where the Administrator and any other authorized representative are not a party, even if the User received information about these Services using the Portal and Mobile Apps, or if the Administrator and any other authorized representative in any other way contributed to the conclusion of such agreements.</p>\r\n<p>5.6. يتم تقديم الخدمات للمستخدمين من قبل أطراف ثالثة على أساس اتفاقيات معينة بين مستخدمين محددين وأطراف ثالثة، حيث لا يكون المسؤول وأي ممثل آخر مخول طرفًا فيها، حتى لو تلقى المستخدم معلومات حول هذه الخدمات باستخدام البوابة وتطبيقات الهاتف المحمول، أو إذا ساهم المسؤول وأي ممثل آخر مخول بأي طريقة أخرى في إبرام هذه الاتفاقيات.</p>\r\n<p>5.7. The Administrator and any other authorized representatives are not responsible for the timing, quality of information about these Services, nor are they liable towards Users for any negative effects or damage (losses) caused to the User due to failure or improper provision of Services by third parties.</p>\r\n<p>5.7. المسؤول وأي ممثلين آخرين مخولين ليسوا مسؤولين عن توقيت وجودة المعلومات المتعلقة بهذه الخدمات، كما أنهم ليسوا مسؤولين تجاه المستخدمين عن أي آثار سلبية، أو أضرار (خسائر) تلحق بالمستخدم بسبب عدم توفير الخدمات أو توفيرها بشكل غير سليم من قبل أطراف ثالثة.</p>\r\n<p>---</p>\r\n<p>## 6. LIMITS FOR PORTAL AND MOBILE APPS SERVICES USE<br>## 6. حدود استخدام خدمات البوابة وتطبيقات الجوال</p>\r\n<p>6.1. While using Services of the Portal and Mobile Apps, the User may post information and intellectual property items (hereinafter referred to as the Content). In addition, at posting the Content, the User guarantees that they rightfully own such content or proprietary rights for it and/or have received all necessary permits from third parties for posting such Content. If there are claims towards the Administrator, the User shall settle such claims by themselves and at their own expense or reimburse losses incurred by the latter due to improper placement of Content on the Portal and Mobile Apps by the User.</p>\r\n<p>6.1. أثناء استخدام خدمات البوابة وتطبيقات الهاتف المحمول، يجوز للمستخدم نشر معلومات وعناصر ملكية فكرية (يشار إليها فيما بعد بـ \"المحتوى\"). بالإضافة إلى ذلك، عند نشر المحتوى، يضمن المستخدم أنه يمتلك هذا المحتوى أو حقوق الملكية الخاصة به و/أو حصل على جميع التصاريح اللازمة من أطراف ثالثة لنشر هذا المحتوى. إذا كانت هناك مطالبات ضد المسؤول، يجب على المستخدم تسوية هذه المطالبات بنفسه وعلى نفقته الخاصة أو تعويض الخسائر التي تكبدها المسؤول بسبب الوضع غير السليم للمحتوى على البوابة وتطبيقات الهاتف المحمول من قبل المستخدم.</p>\r\n<p>6.2. The User agrees not to use the Services of the Portal and Mobile Apps for transmission, posting or spreading of information by any means, the content of which is unlawful, threatening, defamatory, offensive, infringing intellectual property rights, spreading hatred and/or discrimination against people by any grounds, contains offenses and claims towards other Users, the Administrator or any third parties whose rights are specified by the Law of Qatar \"On the protection of public morality\", the Constitution of Qatar and other relevant regulations. Distribution of any erotic, sexual or pornographic information on the Portal and Mobile Apps is also prohibited. In case the Administrator incurs any losses related with posting of illegal information on the Portal, the User shall reimburse such losses of the Administrator in full amount.</p>\r\n<p>6.2. يوافق المستخدم على عدم استخدام خدمات البوابة وتطبيقات الهاتف المحمول لنقل أو نشر أو توزيع معلومات بأي وسيلة، يكون محتواها غير قانوني، أو مهددًا، أو تشهيريًا، أو مسيئًا، أو منتهكًا لحقوق الملكية الفكرية، أو ينشر الكراهية و/أو التمييز ضد الأشخاص لأي سبب كان، أو يحتوي على تجاوزات ومطالبات تجاه مستخدمين آخرين، أو المسؤول، أو أي أطراف ثالثة يتم تحديد حقوقها بموجب قانون دولة قطر \"بشأن حماية الآداب العامة\"، ودستور قطر واللوائح الأخرى ذات الصلة. كما يُحظر توزيع أي معلومات ذات طبيعة جنسية أو إباحية على البوابة وتطبيقات الهاتف المحمول. في حال تكبد المسؤول أي خسائر تتعلق بنشر معلومات غير قانونية على البوابة، يجب على المستخدم تعويض هذه الخسائر للمسؤول بالكامل.</p>\r\n<p>6.3. The Administrator takes no action and is not responsible for the reliability of information, accuracy and legitimacy of posting Content on the Portal and Mobile Apps. The Administrator does not verify the Content posted by the Users and/or legally reproduced from other sources, including the Internet, provided that there is specified the source of such content, and bears no responsibility for its accuracy and legitimacy.</p>\r\n<p>6.3. لا يتخذ المسؤول أي إجراء وليس مسؤولاً عن موثوقية المعلومات ودقتها وشرعية نشر المحتوى على البوابة وتطبيقات الهاتف المحمول. لا يتحقق المسؤول من المحتوى الذي ينشره المستخدمون و/أو الذي يتم نسخه بشكل قانوني من مصادر أخرى، بما في ذلك الإنترنت، شريطة تحديد مصدر هذا المحتوى، ولا يتحمل أي مسؤولية عن دقته وشرعيته.</p>\r\n<p>6.4. While using the Portal and Mobile Apps, the Users have no right to store, post, transmit or otherwise distribute any information and/or intellectual property items that may lead to the violation of third parties\' rights, including the right for Personal Data protection.</p>\r\n<p>6.4. أثناء استخدام البوابة وتطبيقات الهاتف المحمول، لا يحق للمستخدمين تخزين أو نشر أو نقل أو توزيع أي معلومات و/أو عناصر ملكية فكرية بأي طريقة قد تؤدي إلى انتهاك حقوق أطراف ثالثة، بما في ذلك الحق في حماية البيانات الشخصية.</p>\r\n<p>6.5. While using of the Portal and Mobile Apps, the Users cannot carry out any actions that violate or can be the result of a violation of the applicable legislation of Qatar or legislation of other states where the User is located, as well as relevant international legislation.</p>\r\n<p>6.5. أثناء استخدام البوابة وتطبيقات الهاتف المحمول، لا يجوز للمستخدمين اتخاذ أي إجراءات تنتهك أو يمكن أن تؤدي إلى انتهاك التشريعات المعمول بها في قطر أو تشريعات الدول الأخرى التي يتواجد فيها المستخدم، وكذلك التشريعات الدولية ذات الصلة.</p>\r\n<p>6.6. Provision of information Services and advertising on the Portal and Mobile Apps is performed exclusively by the Administrator or under condition of prior written consent of the Administrator. The Users cannot carry out unauthorized placement of advertising information, otherwise the User shall reimburse the incurred losses to the Administrator in full amount.</p>\r\n<p>6.6. يتم تقديم خدمات المعلومات والإعلانات على البوابة وتطبيقات الهاتف المحمول حصريًا من قبل المسؤول أو بشرط الحصول على موافقة خطية مسبقة من المسؤول. لا يجوز للمستخدمين القيام بوضع إعلانات غير مصرح بها، وإلا يجب على المستخدم تعويض المسؤول عن الخسائر المتكبدة بالكامل.</p>\r\n<p>6.7. Information posted on the Portal and Mobile Apps shall not include:</p>\r\n<p>6.7. لا يجوز أن تتضمن المعلومات المنشورة على البوابة وتطبيقات الهاتف المحمول ما يلي:</p>\r\n<p>&bull; restriction of rights of minorities;<br>&bull; تقييد حقوق الأقليات؛</p>\r\n<p>&bull; false representation as another person or representative of a company and/or community without sufficient rights, concerning also the staff and owners of the Administrator, as well as misrepresentation on properties and characteristics of any entities or objects;<br>&bull; التمثل الكاذب لشخص آخر أو ممثل شركة و/أو مجتمع دون حقوق كافية، بما في ذلك موظفي ومالكي المسؤول، بالإضافة إلى التضليل بشأن خصائص وصفات أي كيانات أو أشياء؛</p>\r\n<p>&bull; materials which the User has no right to disclose according to the law or in accordance with any contractual relations;<br>&bull; المواد التي لا يحق للمستخدم الكشف عنها بموجب القانون أو وفقًا لأي علاقات تعاقدية؛</p>\r\n<p>&bull; materials violating rights concerning any patent, trademark, trade secret, copyright or other proprietary rights and/or copyright and adjacent rights of third party;<br>&bull; المواد التي تنتهك حقوق أي براءة اختراع أو علامة تجارية أو سر تجاري أو حقوق نشر أو غيرها من حقوق الملكية و/أو حقوق النشر والحقوق المجاورة لطرف ثالث؛</p>\r\n<p>&bull; adware, \"spam\" correspondence, \"chain letters\", invitation to financial Services or imposing of Services otherwise;<br>&bull; برامج الإعلانات المتسللة، أو المراسلات \"البريد المزعج\"، أو \"الرسائل المتسلسلة\"، أو دعوات الخدمات المالية أو فرض الخدمات بطريقة أخرى؛</p>\r\n<p>&bull; materials containing computer codes designed to breach, destroy or limit the functionality of any computer or telecommunications equipment or programs to perform illegal access as well as serial numbers to commercial software products, logins, passwords and other means to obtain unauthorized access to paid resources of the Internet;<br>&bull; المواد التي تحتوي على رموز حاسوبية مصممة لاختراق أو تدمير أو تحديد وظائف أي جهاز حاسوبي أو معدات اتصالات أو برامج لتنفيذ وصول غير قانوني، بالإضافة إلى الأرقام التسلسلية لمنتجات البرمجيات التجارية، وأسماء المستخدمين، وكلمات المرور، وغيرها من وسائل الحصول على وصول غير مصرح به إلى الموارد المدفوعة على الإنترنت؛</p>\r\n<p>&bull; drugs advertising;<br>&bull; إعلانات المخدرات؛</p>\r\n<p>&bull; posts with rude and offensive remarks and proposals addressing to anyone;<br>&bull; منشورات تحمل ملاحظات واقتراحات فظة ومسيئة موجهة إلى أي شخص؛</p>\r\n<p>&bull; posts with pornographic content.<br>&bull; منشورات ذات محتوى إباحي.</p>\r\n<p>6.8. Any materials received by User through the Portal and Mobile Apps are applied by the User at their own risk. The User is solely responsible for any damage to the computer and/or data after downloading and using of these materials.</p>\r\n<p>6.8. أي مواد يتلقاها المستخدم من خلال البوابة وتطبيقات الهاتف المحمول يتم تطبيقها من قبل المستخدم على مسؤوليته الخاصة. المستخدم هو المسؤول الوحيد عن أي ضرر للكمبيوتر و/أو البيانات بعد تنزيل واستخدام هذه المواد.</p>\r\n<p>6.9. The Administrator shall inform the User about claims of third parties concerning the Content posted by the User. The User agrees to provide the Administrator with the data about the rights for the Content or to delete the Content.</p>\r\n<p>6.9. يقوم المسؤول بإبلاغ المستخدم بالمطالبات المقدمة من أطراف ثالثة فيما يتعلق بالمحتوى الذي ينشره. يوافق المستخدم على تزويد المسؤول بالبيانات المتعلقة بحقوق المحتوى أو حذف المحتوى.</p>\r\n<p>6.10. The Administrator has a right to provide available information about the User, without excluding Personal Data, to the state authority upon first demand of such appropriate authorized (law enforcement) authority in accordance with the applicable legislation.</p>\r\n<p>6.10. يحق للمسؤول تقديم المعلومات المتاحة عن المستخدم، دون استثناء البيانات الشخصية، إلى السلطة الحكومية بناءً على الطلب الأول لتلك السلطة المختصة (إنفاذ القانون) وفقًا للتشريعات المعمول بها.</p>\r\n<p>---</p>\r\n<p>## 7. EXCLUSIVE RIGHTS AND GUARANTEES OF ADMINISTRATOR<br>## 7. الحقوق الحصرية وضمانات المسؤول</p>\r\n<p>7.1. The Portal, Mobile Apps, any of its components, including source code, design elements, text and other intellectual property items are the exclusive property of the Administrator.</p>\r\n<p>7.1. البوابة، وتطبيقات الهاتف المحمول، وأي من مكوناتها، بما في ذلك الكود المصدري، وعناصر التصميم، والنصوص، وغيرها من عناصر الملكية الفكرية هي ملكية حصرية للمسؤول.</p>\r\n<p>7.2. This Agreement does not provide any rights or permissions for the User to use the Portal and Mobile Apps by means other than those provided according to the functionality of the Portal and Mobile Apps.</p>\r\n<p>7.2. لا توفر هذه الاتفاقية أي حقوق أو تصاريح للمستخدم لاستخدام البوابة وتطبيقات الهاتف المحمول بأي وسيلة أخرى بخلاف تلك المنصوص عليها وفقًا لوظائف البوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>7.3. The Portal is available to Users according to the \"as is\" principle. The Administrator undertakes no guarantees for the smooth operation of the Portal and Mobile Apps Services, timeliness and accuracy of their operation as for verification of any facts and compliance of the Services of the Portal and Mobile Apps with objectives of the User.</p>\r\n<p>7.3. البوابة متاحة للمستخدمين على أساس \"كما هي\". لا يقدم المسؤول أي ضمانات لعمل خدمات البوابة وتطبيقات الهاتف المحمول بسلاسة، أو توقيتها ودقتها، أو للتحقق من أي حقائق وتوافق خدمات البوابة وتطبيقات الهاتف المحمول مع أهداف المستخدم.</p>\r\n<p>---</p>\r\n<p>## 8. LIABILITY LIMITATION OF ADMINISTRATOR<br>## 8. تحديد مسؤولية المسؤول</p>\r\n<p>8.1. The Administrator and any other authorized representatives are not liable for any damage to life and health, any direct and/or indirect losses, material and/or non-material damage, liabilities or losses incurred as a result of the using or non-using of information posted on the Portal and Mobile Apps as well as using of the Services of Administrator and which may be caused by incomplete or untimely providing of information Services by the Portal and Mobile Apps; or lack of opportunities to access Services or use them; or failure to provide or improper provision of Services to Users by any third parties; or any actions or omissions of third parties; or availability or lack of third parties\' authorities, permits, licenses, approvals, the presence or absence of third parties\' special legal status etc.; or unauthorized distribution, modification or destruction of Users\' information as a result of any use of the Portal and Mobile Apps.</p>\r\n<p>8.1. المسؤول وأي ممثلين آخرين مخولين ليسوا مسؤولين عن أي ضرر يلحق بالحياة والصحة، وأي خسائر مباشرة و/أو غير مباشرة، وأضرار مادية و/أو غير مادية، أو مسؤوليات أو خسائر متكبدة نتيجة استخدام أو عدم استخدام المعلومات المنشورة على البوابة وتطبيقات الهاتف المحمول، وكذلك استخدام خدمات المسؤول، والتي قد تنجم عن تقديم خدمات معلومات غير مكتملة أو غير في الوقت المناسب من قبل البوابة وتطبيقات الهاتف المحمول؛ أو نقص فرص الوصول إلى الخدمات أو استخدامها؛ أو عدم توفير الخدمات أو توفيرها بشكل غير سليم للمستخدمين من قبل أي أطراف ثالثة؛ أو أي أفعال أو إغفالات من قبل أطراف ثالثة؛ أو توافر أو نقص صلاحيات وتصاريح وتراخيص وموافقات الأطراف الثالثة، ووجود أو عدم وجود وضع قانوني خاص للأطراف الثالثة وما إلى ذلك؛ أو التوزيع غير المصرح به، أو تعديل أو تدمير معلومات المستخدمين نتيجة لأي استخدام للبوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>8.2. The Administrator does not guarantee regular or unconditional access to the Services provided on the Portal and Mobile Apps. Force majeure and other factors, prevention or elimination of which is beyond the capacity of the Administrator, may disturb the functioning of the Portal and Mobile Apps.</p>\r\n<p>8.2. لا يضمن المسؤول وصولاً منتظمًا أو غير مشروط للخدمات المقدمة على البوابة وتطبيقات الهاتف المحمول. قد تعطل الظروف القاهرة وعوامل أخرى، التي لا يستطيع المسؤول منعها أو إزالتها، عمل البوابة وتطبيقات الهاتف المحمول.</p>\r\n<p>8.3. The Administrator is always willing to take into consideration the suggestions and proposals of any User of the Portal and Mobile Apps concerning its operation.</p>\r\n<p>8.3. المسؤول مستعد دائمًا لأخذ اقتراحات ومقترحات أي مستخدم للبوابة وتطبيقات الهاتف المحمول فيما يتعلق بعملها بعين الاعتبار.</p>\r\n<p>---</p>\r\n<p>## 9. FINAL PROVISIONS<br>## 9. أحكام ختامية</p>\r\n<p>9.1. This Agreement is a contract between the User and Administrator concerning the procedure of use of the Services of the Portal and Mobile Apps and it supersedes all prior agreements between the User and Administrator.</p>\r\n<p>9.1. تشكل هذه الاتفاقية عقدًا بين المستخدم والمسؤول بخصوص إجراءات استخدام خدمات البوابة وتطبيقات الهاتف المحمول، وتحل محل جميع الاتفاقيات السابقة بين المستخدم والمسؤول.</p>\r\n<p>9.2. The present Agreement shall be governed by and construed in accordance with the legislation of Qatar. Issues other than regulated by this Agreement shall be settled in accordance with the applicable legislation of Qatar. All possible disputes arising from relations governed by this Agreement shall be settled in the manner prescribed by the applicable legislation of Qatar at the place of location of the Administrator. Throughout the text of this Agreement, unless expressly stated otherwise, the term \"legislation\" refers to the legislation of Qatar.</p>\r\n<p>9.2. تخضع هذه الاتفاقية وتُفسر وفقًا لتشريعات قطر. يتم تسوية المسائل الأخرى التي لم تنظمها هذه الاتفاقية وفقًا للتشريعات القطرية المعمول بها. يتم تسوية جميع النزاعات المحتملة الناشئة عن العلاقات التي تحكمها هذه الاتفاقية بالطريقة المنصوص عليها في التشريعات القطرية المعمول بها في مكان وجود المسؤول. طوال نص هذه الاتفاقية، ما لم يُنص صراحة على خلاف ذلك، يشير مصطلح \"التشريع\" إلى تشريع قطر.</p>\r\n<p>9.3. Considering cost-free Services provided under this Agreement, the rules on consumer protection stipulated by the legislation of Qatar cannot be applied to relations between the User and Administrator.</p>\r\n<p>9.3. بالنظر إلى الخدمات المجانية المقدمة بموجب هذه الاتفاقية، لا يمكن تطبيق قواعد حماية المستهلك المنصوص عليها في تشريعات قطر على العلاقات بين المستخدم والمسؤول.</p>\r\n<p>9.4. Nothing in this Agreement shall be understood as the establishment between the User and Administrator of agency relationships, assignments, company relations, and relations as for joint activity, employment or any other relationship not expressly provided in the Agreement.</p>\r\n<p>9.4. لا يُفهم أي بند في هذه الاتفاقية على أنه يؤسس بين المستخدم والمسؤول علاقات وكالة، أو تنازلات، أو علاقات شراكة، وعلاقات فيما يتعلق بالنشاط المشترك، أو التوظيف، أو أي علاقة أخرى لم ينص عليها صراحة في الاتفاقية.</p>\r\n<p>9.5. In case one or more provisions of this Agreement shall be deemed invalid or such as have no legal effect because of any reasons, it does not affect the validity or applicability of the other provisions of the Agreement.</p>\r\n<p>9.5. في حال اعتبار بند واحد أو أكثر من أحكام هذه الاتفاقية باطلاً أو لا يوجد له أثر قانوني لأي سبب من الأسباب، فإن ذلك لا يؤثر على صلاحية أو قابلية تطبيق الأحكام الأخرى للاتفاقية.</p>\r\n<p>9.6. Inaction of the Administrator as for violation of the Agreement by the User or other Users does not preclude Administrator\'s rights to take appropriate actions to protect its rights later and does not specify the Administrator\'s waiver in case of further such or similar violations.</p>\r\n<p>9.6. عدم اتخاذ المسؤول إجراءات بشأن انتهاك المستخدم أو المستخدمين الآخرين للاتفاقية لا يحول دون حقوق المسؤول في اتخاذ الإجراءات المناسبة لحماية حقوقه في وقت لاحق، ولا يشير إلى تنازل المسؤول في حالة حدوث انتهاكات أخرى مماثلة أو متشابهة.</p>\r\n<p>9.7. The User confirms that they have acquainted themselves with Payment Policy and Cancellation Policy, placed on the Portal and Mobile Apps, and give their full, unconditional and irrevocable consent to their terms.</p>\r\n<p>9.7. يقر المستخدم بأنه قد اطلع على سياسة الدفع وسياسة الإلغاء، المنشورتين على البوابة وتطبيقات الهاتف المحمول، ويمنح موافقته الكاملة وغير المشروطة وغير القابلة للإلغاء على شروطها.</p>\r\n<p>&nbsp;</p>'),
(11, 'privacy_policy', 'privacy_policy', '<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">This Privacy Policy has been developed by </span></span><span class=\"TextRun MacChromeBold SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">RideGo</span></span><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">, the personal data controller in accordance with Qatari law.</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">تم تطوير سياسة الخصوصية هذه من قبل </span></span><span class=\"TextRun MacChromeBold SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">رايد قو</span></span><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">، وهي الجهة المسؤولة عن البيانات الشخصية، وفقًا للقانون القطري</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">First, your privacy matters to us. You have placed your trust in us when using our services, and we truly value that trust. This means we are committed to protecting any personal data you have provided to us.</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">أولاً، خصوصيتك تهمنا. لقد وضعت ثقتك بنا عند استخدام خدماتنا، ونحن نقدّر هذه الثقة حقًا. هذا يعني أننا ملتزمون بحماية أي بيانات شخصية قدّمتها لنا</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">This Privacy Policy applies to any type of personal data we process, the \"RideGo\" and \"RideGo Driver\" mobile applications for iOS and Android (hereinafter referred to as \"Mobile Applications\" or \"Apps\"), as well as through other channels specified in this Privacy Policy.</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">تنطبق سياسة الخصوصية هذه على أي نوع من البيانات الشخصية التي نعالجها، وتطبيقات الهاتف المحمول \"رايد قو\" و\"رايد قو السائق\" لنظامي التشغيل (المشار إليها فيما يلي باسم \"تطبيقات الهاتف المحمول\" أو \"التطبيقات\")</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">You agree to be bound by all the provisions of this Privacy Policy upon registering on the websites and mobile applications. If you do not agree to this Privacy Policy, you will not be able to use the mobile applications or websites.</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">أنت توافق على الالتزام بجميع أحكام سياسة الخصوصية هذه عند تسجيلك في المواقع الإلكترونية وتطبيقات الهاتف المحمول. في حال عدم موافقتك على سياسة الخصوصية هذه، لن تتمكن من استخدام تطبيقات الهاتف المحمول أو مواقع الويب</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">We may amend this Privacy Policy from time to time or change the Privacy Policy without prior notice. You hereby consent to amending the Privacy Statement without any specific confirmation from you. We advise you to check this page regularly to stay informed of the latest changes.</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&quot;335559738&quot;:240,&quot;335559739&quot;:240}\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"OutlineElement Ltr SCXW46081682 BCX0\">\r\n<p class=\"Paragraph SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\"><span class=\"TextRun SCXW46081682 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW46081682 BCX0\">يجوز لنا تعديل سياسة الخصوصية هذه من وقت لآخر أو تغييرها دون إشعار مسبق. أنت توافق بموجب هذا على تعديل بيان الخصوصية دون أي تأكيد محدد منك. ننصحك بمراجعة هذه الصفحة بانتظام للبقاء على اطلاع بأحدث التغييرات</span></span><span class=\"EOP SCXW46081682 BCX0\" data-ccp-props=\"{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;335551550&quot;:0,&quot;335551620&quot;:0,&qu